private static void assertListSelectionEventEquals(ListSelectionEvent expected, ListSelectionEvent actual) {
    if (expected == null) {
        throw new java.lang.IllegalArgumentException("missing expected");
    }
    if (actual == null) {
        throw new java.lang.AssertionError((("Expected " + expected) + ", but was: ") + actual);
    }
    if (!expected.getSource().equals(actual.getSource())) {
        throw new java.lang.AssertionError(((("Expected " + expected) + ", but was: ") + actual) + ". Different source.");
    }
    if (expected.getFirstIndex() != actual.getFirstIndex()) {
        throw new java.lang.AssertionError(((("Expected " + expected) + ", but was: ") + actual) + ". Different first index.");
    }
    if (expected.getLastIndex() != actual.getLastIndex()) {
        throw new java.lang.AssertionError(((("Expected " + expected) + ", but was: ") + actual) + ". Different last index.");
    }
    if (expected.getValueIsAdjusting() != actual.getValueIsAdjusting()) {
        throw new java.lang.AssertionError(((("Expected " + expected) + ", but was: ") + actual) + ". Different ValueIsAdjusting.");
    }
}
